from algopy import ARC4Contract, Bytes, UInt64, op
from algopy.arc4 import abimethod


class LargeContractToUpgradeTo(ARC4Contract):
    @abimethod
    def dummy(self, index: UInt64) -> UInt64:
        # 7 * 1024 bytes to ensure max program page sizes used
        n1 = op.extract_uint64(Bytes.from_hex(""), index)
        n2 = op.extract_uint64(Bytes.from_hex(""), index)
        n3 = op.extract_uint64(Bytes.from_hex(""), index)
        n4 = op.extract_uint64(Bytes.from_hex(""), index)
        n5 = op.extract_uint64(Bytes.from_hex(""), index)
        n6 = op.extract_uint64(Bytes.from_hex(""), index)
        n7 = op.extract_uint64(Bytes.from_hex(""), index)
        return n1 | n2 | n3 | n4 | n5 | n6 | n7
